import React from "react";
import { Link } from "react-router-dom";

const Welcome = () => {
  return (
    <div className="welcome">
          <p>Welcome</p>
          <Link to="/modeselect">
          <p>To ModeSelect</p>
        </Link>
    </div>
  );
};

export default Welcome;
